export const makeShops = (
  length = 10,
  city = '\u798F\u5DDE',
  idOffset = 0,
): ShopNode[] => {
  return Array.from({ length }, (_, index) => {
    const id = idOffset + 1 + index;
    return {
      id: id,
      shopId: 'S' + id,
      shopName: 'SHOP' + id,
      city: city,
    };
  });
};

export const makeArch = (
  id: number,
  shopInfos: ShopNode[] = [],
  children: ArchNode[] = [],
): ArchNode => {
  return {
    id,
    name: '\u8282\u70B9' + id,
    children,
    shopInfos,
  };
};
